module.exports.onLoad = async function({ Cherry }) {
    if (!Cherry.cws) Cherry.cws = new Map();
    Cherry.cws.Ending = new Map();
}

module.exports.run = async function({ api, event, args, Cherry, Users, prefix }) {
    var { threadID, messageID, senderID } = event, { allowInbox } = Cherry.configs;
    if (allowInbox == false) return api.sendMessage(`Để sử dụng lệnh này, vui lòng bật chế độ allowInbox`, threadID, messageID);
    switch (args[0]) {
        case "Nam":
        case "nam":
            if (Cherry.cws.has(senderID) && Cherry.cws.get(senderID).matchStatus == 'match') return api.sendMessage(`Bạn đang trong trạng thái tìm kiếm, vui lòng kết thúc trạng thái này nếu bạn muốn thay đổi đổi tượng tìm kiếm bằng cách gửi ${prefix}match end.`, threadID, messageID);
            if (Cherry.cws.has(senderID) && Cherry.cws.get(senderID).matchStatus == 'Chating') return api.sendMessage(`Bạn đang trong cuộc trò chuyện với mội người lạ khác, vui lòng kết thúc cuộc trò chuyện này trước nếu bạn muốn match một người khác bằng cách gửi ${prefix}match end.`, threadID, messageID);
            var matchData = new Object({
                ID: senderID,
                type: 'match',
                match: 'Nam',
                threadID: threadID,
                prefix: prefix
            });
            Cherry.cws.set(senderID, { matchStatus: 'match' });
            startService({ api, event, Cherry, Users, matchData });
            break;
        case "Nữ":
        case "nữ":
        case "nu":
        case "Nu":
            if (Cherry.cws.has(senderID) && Cherry.cws.get(senderID).matchStatus == 'match') return api.sendMessage(`Bạn đang trong trạng thái tìm kiếm, vui lòng kết thúc trạng thái này nếu bạn muốn thay đổi đổi tượng tìm kiếm bằng cách gửi ${prefix}match end.`, threadID, messageID);
            if (Cherry.cws.has(senderID) && Cherry.cws.get(senderID).matchStatus == 'Chating') return api.sendMessage(`Bạn đang trong cuộc trò chuyện với mội người lạ khác, vui lòng kết thúc cuộc trò chuyện này trước nếu bạn muốn match một người khác bằng cách gửi ${prefix}match end.`, threadID, messageID);
            var matchData = new Object({
                ID: senderID,
                type: 'match',
                match: 'Nữ',
                threadID: threadID,
                prefix: prefix
            })
            Cherry.cws.set(senderID, { matchStatus: true });
            startService({ api, event, Cherry, Users, matchData });
            break;
        case "end":
            cancelMatch({ api, threadID, messageID, senderID, Cherry, prefix, Users });
            break;
        case "report":
            var content = args.slice(1);
            if (content.length == 0) return api.sendMessage(`Bạn phải nhập thêm nội dung muốn report.`, threadID, messageID);
            reportStranger({ api, Cherry, threadID, messageID, content, senderID });
            break;
        default:
            Cherry.commandError(this.info.name, threadID, messageID);
            break;
    }
}
